  //register (user, partner, children, company)\n  //unregister\n  //update (RAF, Date pensionstart, Enum relationship, job)\n  //airdrop\n\n//SETTINGS - Oracle\n  //updateSettings()\n  //settingsOf(uint256 year)\n\n  //rentenartfaktorOf(uint256 year)\n\n  //avgLoan(uint256 startyear,uint256 endyear)\n  //avgLoan(uint256 startyear,uint256 endyear)\n  //avgLoan(uint256 startyear,uint256 endyear)\n  //year => struct()\n  // - rentenWert\n  // - abschl\xe4ge\n  // - zuschl\xe4ge\n  // - year/durchschnittsgehalt\n/*\n  Rentemtl\tist die monatliche Bruttorente in Euro\n  EP\tist die Summe der Entgeltpunkte aufgrund des Versicherungsverlaufs\n  ZF\tist der Zugangsfaktor\n  RAF\tist der Rentenartfaktor\n  aRW\tist der aktuelle Rentenwert in Euro\n\nRenteMtl. = EP * ZF * RAF * aRW\nMonatliche Rentenh\xf6he = Entgeltpunkte x Zugangsfaktor x Rentenartfaktor x Aktueller Rentenwert\n\n  Renten wegen Alters\t1,0\n  Renten wegen voller Erwerbsminderung\t1,0\n  Erziehungsrenten\t1,0\n  gro\xdfe Witwenrente\t0,55\n  Renten wegen teilweiser Erwerbsminderung\t0,5\n  kleine Witwenrente\t0,25\n  Vollwaisenrente\t0,2\n  Halbwaisenrente\t0,1\n*/\n\n//PENSION\n  //pensionOf(address _owner)\n  //withdraw()\n  //function allowance(address _owner) public view returns (uint remaining) {\n  // return allowed[tokenOwner][spender];\n  //}\n\n//WALLET\n  //payTo(address _to, uint256 _value)\n  //pay(company, user)\n  //payout | withdraw\n  //\n\n\n}\n',sourcePath:"C:\\git\\german-pension\\packages\\smartcontracts\\contracts\\Test.sol",ast:{absolutePath:"/C/git/german-pension/packages/smartcontracts/contracts/Test.sol",exportedSymbols:{Test:[2217]},id:2218,nodeType:"SourceUnit",nodes:[{id:2195,literals:["solidity","^","0.4",".23"],nodeType:"PragmaDirective",src:"0:24:10"},{baseContracts:[],contractDependencies:[],contractKind:"contract",documentation:null,fullyImplemented:!0,id:2217,linearizedBaseContracts:[2217],name:"Test",nodeType:"ContractDefinition",nodes:[{constant:!1,id:2197,name:"num",node